OsmAnd prikažuva fotografii od nekolku izvori:
\nOpenPlaceReviews - POI fotografii;
\nMapillary - sliki na nivo na ulica;
\nVeb / Vikimedija - Fotografii na POI spored podatocite na OpenStreetMap.

Anonimnite korisnici ne možat:
\n- Kreirajte grupi;
\n- Sinhronizirajte grupi i uredi so serverot;
\n- Upravuvajte so grupi i uredi vo lična kontrolna tabla na veb-lokacijata.
